+<template>
+    <van-action-sheet v-model:show="dateVisible">
+        <van-date-picker
+            v-model="currentDate"
+            title="选择年月"
+            :min-date="minDate"
+            :max-date="maxDate"
+            :formatter="formatter"
+            :columns-type="columnsType"
+            @confirm="confirmDate"
+            @cancel="cancelDate"
+
+        />
+    </van-action-sheet>
+</template>
+
+<script lang="ts" name="" setup>
+import {  } from 'vue'
+// 日期选择
+let dateVisible=ref(false)
+let currentTime=ref(dayjs().format('YYYY-MM'))
+const currentDate = ref(currentTime.value.split('-'));
+const columnsType = ['year', 'month'];
+const minDate= new Date(2020, 0, 1)
+const maxDate= new Date(2025, 5, 1)
+// 格式化日期选项
+function formatter(type:any, option:object) {
+   if (type === 'year') {
+      option.text += '年';
+   }
+   if (type === 'month'){
+      option.text += '月';
+   }
+   return option;
+}
+async function confirmDate(val:object){
+   currentDate.value=val.selectedValues
+   dateVisible.value=false
+}
+function cancelDate(){
+   console.log('取消');
+   dateVisible.value=false
+}
+const listDate = computed(() => currentDate.value.join('-'));
+</script>
+
+<style scoped>
+
+</style>
